import { useEffect, useState } from "react";
import axios from "axios";

const ModelGrid = () => {
  const [data, setData] = useState({
    diamond: [],
    gold: [],
    trending: [],
  });

  useEffect(() => {
    axios.get("/api/home").then((res) => {
      setData(res.data);
    });
  }, []);

  const renderCard = (model, tag) => (
    <article className="card" key={model._id}>
      <a href={`/model/${model.slug}`} className="card-img">
        <img
          src={model.profileImage?.url || "/images/placeholder.jpg"}
          alt={model.stageName}
          className="card-img-photo"
        />

        {tag && (
          <span className={`card-tag ${tag === "New" ? "card-tag-hot" : ""}`}>
            {tag}
          </span>
        )}
      </a>

      <div className="card-body">
        <div className="card-header-row">
          <h3 className="card-name">{model.stageName}</h3>
          <span className="card-age">{model.age} yrs</span>
          <span className="card-location">{model.location}</span>
        </div>

        <p className="card-nationality">
          Nationality: <span>{model.nationality}</span>
        </p>

        <p className="card-labels">
          <span className="pill">{model.profile_type}</span>
          {model.listing_type !== "default" && (
            <span className="pill">{model.listing_type.toUpperCase()}</span>
          )}
        </p>

        <div className="card-contact">
          <div className="card-contact-row card-contact-row-top">
            <span>{model.location} | Private</span>
            <span>1 hour</span>
          </div>
          <div className="card-contact-row card-contact-row-bottom">
            <span>{model.phone}</span>
            <span>
              {model.currency}
              {model.price_1h}
            </span>
          </div>
        </div>
      </div>
    </article>
  );

  return (
    <section id="profiles" className="profiles">
      <div className="container">
        {/* ===== DIAMOND ===== */}
        <div className="section-head section-head-inline">
          <div>
            <h2>Diamond Escorts From Dubai</h2>
            <p>Ultra-exclusive Dubai companions for VIP clients.</p>
          </div>
        </div>

        <div className="profiles-grid">
          {data.diamond.map((m) => renderCard(m, "VIP"))}
        </div>

        {/* ===== GOLD ===== */}
        <div
          className="section-head section-head-inline"
          style={{ marginTop: 28 }}
        >
          <div>
            <h2>Premier Gold Escorts From Dubai</h2>
          </div>
        </div>

        <div className="profiles-grid">
          {data.gold.map((m) => renderCard(m, "Gold"))}
        </div>

        {/* ===== TRENDING ===== */}
        <div className="section-head" style={{ marginTop: 28 }}>
          <h2>New & Trending Escorts From Dubai</h2>
        </div>

        <div className="profiles-grid">
          {data.trending.map((m) =>
            renderCard(m, m.listing_type === "new" ? "New" : null)
          )}
        </div>
      </div>
    </section>
  );
};

export default ModelGrid;
